webpackJsonp([345],{"./node_modules/json-loader/index.js!./.cache/json/articles-miscellaneous-how-to-know-who-is-in-charge-of-your-campsite-on-facebook.json":function(o,e){o.exports={data:{markdownRemark:{html:'<p>Local communities are ever-changing, and there can be more than one Volunteer Community Manager for your city. To become an Admin in the Facebook group, follow the steps below.</p>\n<p>How to find out who is an Admin for your Local Group:</p>\n<ul>\n<li>First, click the Members tab below the cover photo. Then the click on the dropdown box that says "all members"**</li>\n</ul>\n<p><img src="//discourse-user-assets.s3.amazonaws.com/original/2X/c/cc32710a88436219ac4a02a31e57de577830082b.png"></p>\n<ul>\n<li>Next, use the drop down box to select "Admins"**</li>\n</ul>\n<p><img src="//discourse-user-assets.s3.amazonaws.com/original/2X/c/ca28d984d4ec86bb9fb40326da1c9bb1151ab77c.png"></p>\n<ul>\n<li>You should now be able to see who is designated as an Admin for your Local Group.</li>\n</ul>\n<p><img src="//discourse-user-assets.s3.amazonaws.com/original/2X/9/946354dab087e439a810937de4332ad5e231ccf2.png"></p>\n<p>Message this person to introduce yourself and let them know you\'re interested in being an admin. After this, go schedule your first meetup.</p>',frontmatter:{title:"How to Know Who Is in Charge of Your Campsite on Facebook",parent:"/home/stuart/guides/src/pages/articles/miscellaneous/how-to-know-who-is-in-charge-of-your-campsite-on-facebook/index.md absPath of file"}}},pathContext:{slug:"/articles/miscellaneous/how-to-know-who-is-in-charge-of-your-campsite-on-facebook/"}}}});
